import * as MainActions from 'store/actions/main_actions';

const DEFAULT = {};

export default function(state = DEFAULT, action) {
  switch (action.type) {
    case MainActions.RESET_REDUX:
      return {
        ...state,
      };
    default:
      return state;
  }
}
